import React, { useState } from "react";
import "./App.css";
import Key from "./Key";

function App() {
  let [number, setnumber] = useState(0);
  function handleClick(num) {
    setnumber((number = num));
    alert({ number });
  }
  return (
    <div>
      <div className="result">{number}</div>

      <div>
        <Key number={1} onClick={() => handleClick(1)} />
        <Key number={2} />
        <Key number={3} />
        <Key number={4} />
        <Key number={5} />
      </div>
    </div>
  );
}

export default App;
